script: |
  super -f text -I q685.spq | sort > q685.out

inputs:
  - name: q685.spq
    data: |
      SELECT DISTINCT - cor0.col0 * + tab1.col0 FROM tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q685.out
    data: |
      -21
      -234
      -237
      -448
      -4992
      -5056
      -560
      -6240
      -6320
